import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext


//Get the REQUEST variable present in customerAddressGetByIdTS TEST STEP  and store it in a variable
def reqCustAddGet = testRunner.testCase.testSuite.testCases["customerAddressAllTestCases"].testSteps["customerAddressGetByIdTS"].getPropertyValue("Request")

//Get the value of Address ID and store it in a variable 
def custAddId = testRunner.testCase.testSuite.getPropertyValue("id")
log.info custAddId

//Parse the request and store it in a variable
def parseReq = new XmlHolder(reqCustAddGet)

//Set the Address Id value in xml
parseReq.setNodeValue("//def:customerAddressRepositoryV1GetByIdRequest/addressId", custAddId)

//store the xml in a new varaible
def newXmlCustAddGetTS = parseReq.getXml()

//Set the new Request in customerAddressGetByIdTS Test Step
testRunner.testCase.testSuite.testCases["customerAddressAllTestCases"].testSteps["customerAddressGetByIdTS"].setPropertyValue("Request", newXmlCustAddGetTS)


//Create and store a pointer in a new variable
def custAddGetPointer = testRunner.testCase.testSuite.testCases["customerAddressAllTestCases"].testSteps["customerAddressGetByIdTS"]

//Create and store the object of WsdlTestRunContext in a variable
def contextMover = new WsdlTestRunContext(custAddGetPointer)

//USe the run method of WsdlTestRunContext class to click on the SUBMIT button of customerAddressGetByIdTS TEST STEP
custAddGetPointer.run(testRunner,contextMover)

